import React from 'react';
import s from './my_Posts.module.css';

const MyPosts = () => {
    return (
    <div>
      My posts1
      <div>
        New post2
      </div>
      <div className={s.posts}>
        <div className={s.item}>
          post 2
        </div>
        <div className='{s.item}'>
         cs4
        </div>
      </div>
    </div>
    )
}

export default MyPosts ;
